export class Coordinates {
    constructor(longitude, latitude) {
        this._long = longitude;
        this._lat = latitude;
    }
    equals(suspect) {
        let isEqual = false;
        if (suspect instanceof Coordinates) {
            const other = suspect;
            isEqual = (this.longitude() === other.longitude()) && (this.latitude() === other.latitude());
        }
        return isEqual;
    }
    latitude() {
        return this._lat;
    }
    longitude() {
        return this._long;
    }
}
